<div className="card_info">

<span className="card_catagory">{props.title}</span>

<h3 className="card_title">{props.sname}</h3>

<a href={props.link} target="_blank" rel="noreferrer">

    <button>Watch Now</button>

</a>
          
       </div>
      </div> 

</div>

</>

)

}

export default Card;
